export function Account(props) {

    const [account, setAccount] = useState({
        accId: Number = 101,
        accHolder: String = "AKG"
    })

   const addNewAccount = (ev) => {
      setAccount(ev.target.value)
   }

    return (
        <div>

            <form>
                <label>
                    Name: <input type="text" name="accHolder"></input>
                </label>
            <input type="submit" value="submit" onSubmit={addNewAccount}/>
            <div></div>
            </form>
        </div>
    )
}
